        user_tel: "",
        user_email: "",
        user_postcode: "",
        user_addr: "",
        user_detailaddr: "",
    });
    return(
        <div className="card m-auto">
            <div className="card-body">
                <form className="register-form form">
                    <div className="form-group">
                        <input type="text" className="form-control mx-auto my-2" style={{width:'90%', textAlign:'center'}} 
                        placeholder="ID"
                        required/>
                    </div> 
                </form>
            </div>
        </div>
    )
}

